import React from 'react';
import s from '../../today/bag/bag.module.css'

let ErrorID = (props) => {
    return (
        <div>
            <div className={s.grid_bag}>
                <div className={s.grid_bag1}>
                    <span>{props.id}</span>
                </div>
                <div className={s.grid_bag2}><span>{props.err}</span></div>
                <div className={s.grid_bag3}><span>{props.text}</span></div>
            </div>
        </div>
    )
}

const Test1 = (props) => {
    let test_1_fu = props.data.test1.test1_today.map(el => <ErrorID id={el.number} err={el.error} text={el.textError} />)
    let Test1_Change_bag = () => {// добавить баг запись
        let text_value = Href.current.value;
        // props.ubdateTodayTextarea(text_value)
        let action = change_Bag_ActioaCreator(text_value);
        // props.dispatch(action) 
    }
    return (
        <div style={{ color: "red" }}>
            {test_1_fu}
            <p><textarea ref={Test1_Change_bag} value={props.data.test1.textarea} onChange={Change_bag} /><button onClick={Alert}>dddd</button></p>
        </div>
    )
}
export default Test1;
